import React from 'react';

const dropdownDisplay = {
    hidden: { display: 'none' },
    visible: { display: 'flex' }
}

class Dropdown extends React.Component {
    render() {
        return (
            <div style={this.props.isDropdownOpen ? dropdownDisplay.visible : dropdownDisplay.hidden} className="dropdown">
                <button onClick={this.props.convertFeet} className="btn convert">Ft / In</button>
                <button onClick={this.props.fahrToCelcius} className="btn convert">F / C</button>
                <button>Dark</button>
                <button>Lite</button>
                <button id="close-dropdown" onClick={this.props.closeDropdown}>
                    <span className="dropdown-anchor"/>
                </button>
            </div>
        )
    }
}

export default Dropdown;
